        return <PostedComments mainVideo={element} key={'comments' + index} />;
    })
    console.log(dataJsx)

    return (
        <section>
            <p className="comment-total">
                {VideoData[0].comments.length} Comments
            </p>
            <p>
                Comments Form
            </p>
            {dataJsx}
        </section>
    )
}

export default CommentsSection
